import Expenses from "./components/Expenses";

function App() {
  const expensesArray = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 6, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];
  let titles = [];
  for (let item of expensesArray) {
    titles += item.title;
  }
  console.log(titles);
  return (
    <Expenses
      title={expensesArray[0].title}
      price={expensesArray[1].amount}
      date={expensesArray[2].date}
    />
  );
}

export default App;
